import React from "react";

class Home extends React.Component {
    // constructor
    constructor(props) {
        super(props);
        this.state = {search: "Apache"};
    }

    // render body
    render() {
        return (
            <div style={{ margin: "auto auto", width: "600px", textAlign: "center"}}>
                <img src="/camping-logo.jpg" alt="campground-logo" className="app-logo"/>
                <h2 className="title">CAMPA'ROUND</h2>
                <p><input type="text" value={this.state.search} /></p>

                <style jsx>{`
                    h1,
                    h2,
                    a,
                    p {
                        font-family: 'Roboto';
                    }

                    .title {
                        letter-spacing: 1em;
                        font-size: 2.3em;
                    }

                    .app-logo {
                        width: 250px;
                        height: 200px;
                        border-radius: 50%;
                    }

                    input {
                        height: 32px;
                        padding: 0 15px;
                        border-radius: 31px;
                    }

                `}</style>
            </div>
        )
    }
}

export default Home;
